import "./contact.styles.css";

const ContactPage = () => {
  return (
    <div className="contact-page">
      <h1>
        I would like to <span>thank you</span> for visiting my pet project.
      </h1>
      <p>
        As you may guess, this is a dummy page, based on a 40-hour tutorial, so
        no real contact data is available
      </p>
    </div>
  );
};

export default ContactPage;
